require 'csv'\nrequire 'time'\n\n# Example CSV content\ncsv_content = <<-CSV\nstart_time,end_time\nMon Jul 20 18:25:17 -0400 2009,Mon Jul 20 18:49:43 -0400 2009\nCSV\n\n# Parse CSV\ncsv = CSV.parse(csv_content, headers: true)\n\ncsv.each do |row|\n  start_time = Time.parse(row['start_time'])\n  end_time = Time.parse(row['end_time'])\n  \n  duration = end_time - start_time\n  \n  puts "Duration: #{duration} seconds"\nend